import React, { Component } from 'react'; 
import CardList from './CardList';
import { robots } from './Robots';

const App2 = () => {
    return (
        <div>
            <h1>RoboFriends</h1>

            <CardList robots={robots} />
        </div>
    )
}

export default App2;
